        /* Header Styles + Another Way To Comment */

        header {
            border-radius: 20px;
            background-color: rgb(255, 255, 255);
        }

        /** "nav" in the example*/

        .header-content {
            position: fixed;
            top: 20px;
            right: 20px;
            background: rgba(255, 255, 255, 0.1);
            backdrop-filter: blur(5px);
            -webkit-backdrop-filter: blur(12px);
            border-radius: 16px;
            padding: 10px 30px;
            z-index: 1000;
            box-shadow: 0 8px 30px rgba(0,0,0,0.2);
            
        }

        .logo {
            position: fixed;
            top: 20px;
            left: 20px;
            font-size: 1.5rem;
            font-weight: bold;
            background: rgba(255,255,255,0.1);
            backdrop-filter: blur(5px);
            -webkit-backdrop-filter: blur(5px);
            border-radius: 16px;
            padding: 10px 20px;
            box-shadow: 0 8px 30px rgba(0,0,0,0.2);
            color: white;
        }

        /* Navigation Appearance and Style*/

        nav ul {
            display: flex;
            gap: 30px;
            list-style: none;
        }

        nav li {
            position: relative;
        }

        nav a {
            color: white;
            text-decoration: none;
            font-weight: 500;
            font-size: 1rem;
            padding: 10px 15px;
            position: relative;
            z-index: 10;
            transition: color 0.3s ease;
        }

        /* Blob Hover Effect*/

        nav a::before {
            content: '';
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%) scale(0);
            width: 120%;
            height: 160%;
            background: rgba(255, 255, 255, 0.15);
            filter: blur(8px);
            transition: transform 0.3s ease;
            z-index: -1;

        }

        nav a:hover::before{
            transform:translate(-50%,-50%) scale(1);
        }

        nav a:hover {
            color: orangered;
        }

        /* Main content syling*/



    </style>
</head>

    <header>

        <div class="header-content">

                </ul>
            </nav>
        </div>
    </header>

    <main>
